een goeie film

met Shia LaBeouf, Megan Fox en Josh Duhamel

De strijd op aarde is voorbij, maar die in het universum is net begonnen. Wanneer Sam Witwicky (Shia LaBeouf) de waarheid leert 
over de oude oorsprong van de Transformers, moet hij zijn lot accepteren en zich samenvoegen met Optimus Prime en Bumblebee in 
hun epische strijd tegen de Decepticons, die sterker terug zijn dan ooit en het plan hebben om onze wereld te vernietigen.
